import React from 'react';
import './ConfirmModal.css'

const ConfirmModal = (props) => {
    return (
        <div className="confirmModal">
            <div>
                该操作不可恢复！确认吗？
            </div>
            <div>
                <button>确认</button>
                <button>取消</button>
            </div>
        </div>
    );
};

export default ConfirmModal;
